import Vue from 'vue';
import VueRouter from 'vue-router'
import Home from "./components/HelloWorld.vue";

Vue.use(VueRouter);

const routes = [
    {
        name: "Home",
        component: Home,
        path: "/"
    }
];

const router = new VueRouter({
    routes,
    mode: "history",
});

export default router;
